import React from "react"
class App extends React.Component{
  constructor() {
        super()
        this.state = {
          text: "İlk React Projesi",
          auth:true
        }
  }

  render() {
  return (
    <div className="container">
      <h5>{this.state.text}</h5>
      {this.state.auth?<p>Doğrulandı</p>:<p>Doğrulanmadı</p>}
    </div>
  );
}
}

export default App;
